# Given DNA string
s = ""

# Dictionary for complementary bases
complements = {
    "A": "T",
    "T": "A",
    "C": "G",
    "G": "C"
}

# Step 1: Find the complement of each nucleotide in reverse order
reverse_complement = "".join(complements[base] for base in reversed(s))

# Output the reverse complement
print(reverse_complement)